@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM rdf:type rdfs:Class .

atm:displays rdf:type rdf:Property ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Amount .

atm:initiates rdf:type rdf:Property ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:WithdrawalSequence .

atm:Amount rdf:type rdfs:Class .

atm:WithdrawalSequence rdf:type rdfs:Class .
